if mibBuilder.loadTexts: chasControlActivateTimeout.setStatus('current')
if mibBuilder.loadTexts: chasControlActivateTimeout.setDescription('This value is in seconds. It represents how much time before the switch automatically falls back to the certified version. This value is set via the Activate(reload working) cli command. An Activate reboot must be initiated via the primary CMM and that the timeout value can be accessed via user interface to the primary CMM only. After the Activate reboot has been initiated, a timeout will occur (i.e., an Activate Timeout) at the timeout value specified by the user. If a reboot cancel has not been received prior to the timeout expiration, the primary CMM will automatically reboot (i.e., re-reboot) using the certified configuration. This ensures that an automatic backup reboot is available using the certified configuration in the event that the user is unable to interface with primary CMM as a result of the attempted Activate reboot. If the Activate reboot is successful, the user cancels the backup reboot via the normal reboot cancellation process (i.e., a zero value is written for the object chasControlDelayedRebootTimer).')
chasControlVersionMngt = MibTableColumn((1, 3, 6, 1, 4, 1, 6486, 801, 1, 1, 1, 3, 1, 1, 1, 1, 2), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7, 8, 9))).clone(namedValues=NamedValues(("notSignificant", 1), ("certifySynchro", 2), ("certifyNoSynchro", 3), ("flashSynchro", 4), ("restore", 5), ("activate", 6), ("issu", 7), ("shutdown", 8), ("vcConvert", 9)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: chasControlVersionMngt.setStatus('current')
if mibBuilder.loadTexts: chasControlVersionMngt.setDescription('For the primary this means: notSignificant - No command applied. certifySynchro - Copy the file from the working to the certified directory and from the primary to the secondary (reboot of the secondary). certifyNoSynchro - Copy the file from the working to the certified directory. flashSynchro - Copy the file from the primary to the secondary (reboot of the secondary). restore - Copy the file from the certified directory to the working directory. activate - Reload from the working directory. Activate can be scheduled. issu - In Service Software Upgrade (ISSU). shutdown - Shutdown chassis specified by chasControlChassisId. Halts and powers off NIs, halts primary and secondary CMMs. vcConvert - Copy the image files from the running directory to the working directory.')
