if mibBuilder.loadTexts: chasEntPhysAdminStatus.setDescription('All modules (even empty slots) are in unknown state when the chassis first powers up. Chassis status possible value: powerOn <=> powered up Control Module possible value: powerOn <=> CM up and running reset <=> CM reset takeover <=> Secondary CM takes over resetAll <=> resets the whole switch vcTakeover <=> Reloads master chassis from the current working directory, which initiates a VC takeover. vcResetAll <=> resets entire VC. NI status possible value: powerOn <=> NI is either powered (up or down) or waiting to be powered whenever more power is available. This admin status has not full meaning without chasEntPhysOperStatus powerOff <=> NI down and unpowered and NI will not be powered until user requests it, a failover happens or a reboot happens reset <=> NI reset FABRIC status possible value: powerOn <=> FABRIC is powered powerOff <=> FABRIC is unpowered standby <=> FABRIC is powered and requested to be redundant (inactive) Daughter board status possible value: powerOn <=> DB up and running reset <=> DB reset (TO BE CONFIRMED) Power supply status possible value: powerOn <=> PS up')
